import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, View, Pressable, Text } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Color, Border, FontFamily, FontSize } from "../GlobalStyles";

const AndroidSmall2 = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.androidSmall2}>
      <Image
        style={[styles.androidSmall2Child, styles.vectorIconPosition]}
        contentFit="cover"
        source={require("../assets/ellipse-2.png")}
      />
      <Pressable
        style={[styles.androidSmall2Item, styles.rectangleViewLayout]}
        onPress={() => navigation.navigate("AndroidSmall3")}
      />
      <View
        style={[styles.androidSmall2Inner, styles.androidSmall2InnerLayout]}
      />
      <View style={[styles.rectangleView, styles.rectangleViewLayout]} />
      <Pressable
        style={[styles.rectanglePressable, styles.androidSmall2InnerLayout]}
        onPress={() => navigation.navigate("AndroidSmall5")}
      />
      <Image
        style={[
          styles.undrawDeliveryTruckVt6p1Icon,
          styles.androidSmall2Child1Layout,
        ]}
        contentFit="cover"
        source={require("../assets/undraw-delivery-truck-vt6p-1.png")}
      />
      <Image
        style={styles.undrawShoppingAppFlsj1Icon}
        contentFit="cover"
        source={require("../assets/undraw-shopping-app-flsj-1.png")}
      />
      <Image
        style={styles.undrawChartsRe5qe91Icon}
        contentFit="cover"
        source={require("../assets/undraw-charts-re-5qe9-1.png")}
      />
      <Image
        style={styles.undrawEmptyCartCo351Icon}
        contentFit="cover"
        source={require("../assets/undraw-empty-cart-co35-1.png")}
      />
      <Text style={[styles.import, styles.importFlexBox]}>import</Text>
      <Text style={[styles.report, styles.reportFlexBox]}>report</Text>
      <Text style={[styles.transfer, styles.reportFlexBox]}>transfer</Text>
      <Text style={[styles.export, styles.importFlexBox]}>export</Text>
      <Image
        style={[styles.vectorIcon, styles.vectorIconPosition]}
        contentFit="cover"
        source={require("../assets/vector-6.png")}
      />
      <Pressable
        style={[styles.androidSmall2Child1, styles.androidSmall2Child1Layout]}
        onPress={() => navigation.navigate("AndroidSmall4")}
      />
      <Text style={styles.allInventory}>All Inventory</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  vectorIconPosition: {
    left: 0,
    position: "absolute",
  },
  rectangleViewLayout: {
    height: 111,
    width: 111,
    backgroundColor: Color.paleturquoise_300,
    borderRadius: Border.br_3xs,
    left: 39,
    position: "absolute",
  },
  androidSmall2InnerLayout: {
    backgroundColor: Color.paleturquoise_200,
    left: 210,
    height: 111,
    width: 111,
    borderRadius: Border.br_3xs,
    position: "absolute",
  },
  androidSmall2Child1Layout: {
    height: 57,
    position: "absolute",
  },
  importFlexBox: {
    height: 19,
    width: 99,
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    textAlign: "center",
    color: Color.black,
    fontFamily: FontFamily.nunitoRegular,
    letterSpacing: -0.2,
    fontSize: FontSize.size_sm,
    top: 264,
    position: "absolute",
  },
  reportFlexBox: {
    top: 434,
    height: 19,
    width: 99,
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    textAlign: "center",
    color: Color.black,
    fontFamily: FontFamily.nunitoRegular,
    letterSpacing: -0.2,
    fontSize: FontSize.size_sm,
    position: "absolute",
  },
  androidSmall2Child: {
    top: 0,
    width: 207,
    height: 207,
  },
  androidSmall2Item: {
    top: 153,
  },
  androidSmall2Inner: {
    top: 323,
  },
  rectangleView: {
    top: 323,
  },
  rectanglePressable: {
    top: 153,
  },
  undrawDeliveryTruckVt6p1Icon: {
    top: 356,
    left: 49,
    width: 91,
    overflow: "hidden",
  },
  undrawShoppingAppFlsj1Icon: {
    top: 173,
    left: 64,
    width: 72,
    height: 72,
    position: "absolute",
    overflow: "hidden",
  },
  undrawChartsRe5qe91Icon: {
    top: 350,
    left: 238,
    width: 65,
    height: 68,
    position: "absolute",
    overflow: "hidden",
  },
  undrawEmptyCartCo351Icon: {
    top: 183,
    left: 239,
    width: 57,
    height: 60,
    position: "absolute",
    overflow: "hidden",
  },
  import: {
    left: 46,
  },
  report: {
    left: 214,
  },
  transfer: {
    left: 44,
  },
  export: {
    left: 217,
  },
  vectorIcon: {
    top: 522,
    width: 420,
    height: 118,
  },
  androidSmall2Child1: {
    top: 562,
    left: 15,
    borderRadius: Border.br_8xs,
    backgroundColor: Color.paleturquoise_100,
    width: 330,
  },
  allInventory: {
    top: 575,
    left: 109,
    fontSize: FontSize.size_5xl,
    fontWeight: "700",
    fontFamily: FontFamily.outfitBold,
    color: Color.gray,
    textAlign: "left",
    position: "absolute",
  },
  androidSmall2: {
    backgroundColor: Color.white,
    flex: 1,
    width: "100%",
    height: 640,
    overflow: "hidden",
  },
});

export default AndroidSmall2;
